import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

import alphard from "../image/mobil/alphard.webp";

export default function DetailMobil() {
    return (
        <>
            <Navbar />
            <div className="container w-100 h-auto mt-40 mx-auto rounded-xl p-10 bg-[#F4F6F5]">
                <h1 className="font-black text-4xl text-left mb-10">
                    DETAIL PENYEWAAN
                </h1>
                <img src={alphard} alt="" />
            </div>
            <Footer />
        </>
    );
}
